import axios from 'axios'
import React, { useEffect, useState } from 'react'
import { StoreBaseUrl } from '../../../constants'

function ShopOwnerDashboard(props) {

    const [stores, setStores]= useState([])

    const getStores = async()=>{
        axios.get(StoreBaseUrl + 'user/stores', {
            'headers':{
                'Authorization':`Token ${localStorage.getItem('token')}`
            }
        }).then((res)=>{
            console.log(res.data)
            setStores(res.data)
        }).catch((e)=>{
            console.log(e)
        })
    }

    useEffect(()=>{
        getStores()
    },[])

  return (
    <div>
      ShopOwnerDashboard
      <p>username {props.user.username}</p>
      <p>password {props.user.password}</p>
      <p>email {props.user.email}</p>
      <p>contact {props.user.contact}</p>
      <p>id {props.user.id}</p>

      {stores.map(store=>{
        return (
            <>
            <p>store name : {store.store_name}</p>
            <p>store license : {store.store_license_number}</p>
            </>
        )
      })}
    </div>
  )
}

export default ShopOwnerDashboard
